const Autobiography = () => {
    return(    
        <section class="resume-section" id="autobiography">
        <div class="resume-section-content">
            <h2 class="mb-5">Autobiography</h2>
            <ul class="fa-ul mb-0">
                我是李偉華，生長於桃園南崁，高中畢業於中央大學附屬中壢高中，目前就讀政治大學資訊科學系四年級。
                從小就對新的事物抱有強烈的好奇心。高中時對數學有較大的興趣，喜歡定義問題，再找尋問題的解決方法。
                也能在解決問題後得到成就感，因此在那時就下定決心要朝數學系前進。
                上大學後，接觸到更多的資源，發現能應用數學在程式上以解決各種問題，更令我感到興趣，
                因此決定要轉至目前就讀的資訊科學系。
            </ul>
        </div>
    </section>);
}

export default Autobiography;
